$(function(){$(".button-collapse").sideNav(),$(".parallax").parallax(),$(".modal").modal({dismissible:!1,opacity:.5,inDuraction:1e3,outDuraction:1e3,startingTop:"10%",endingTop:"10%"}),$(".carousel.carousel-slider").carousel({fullWidth:!0,indicators:!0,duration:300,noWrap:!0})}),$(function(){$.getJSON("data/product.json",function(a){var d="";for(var c in a.products)d+="<div class='col xl3 l4 m6 s12'><div class='card hoverable small'><div class=card-image><img src="+a.products[c].image+" alt=Product><span class=card-title>"+a.products[c].title+"</span></div><div class=card-content><p>"+a.products[c].description+"</p></div><div class=card-action><a href="+a.products[c].reference+">Link blog</a></div></div></div>";$("#card-product").append(d)})}),$.delay(1e3).document(function(){$("#card-product").css("border","solid 1px red")});